const countdownDisplay = document.querySelector('.display__questions-left');
const countdownTextDisplay = document.querySelector('.display__questions-left-text');
const countdownButtonDisplay = document.querySelector('.display__round-button');
const buttons = document.querySelectorAll('[data-qnum]');
const audio = new Audio("data:audio/wav;base64,");


function setupCountdown(qnum) {
    displayRoundsLeft(qnum);
    displayRoundsLeftText();
    if (countdownButtonDisplay.children.length > 0) {
        return;
    }   
    displayRoundButton();
}

function displayRoundsLeft(qnum) {
    const display = `${qnum}`;
    
    countdownDisplay.textContent = display;
    document.title = `Countdown ${display}`;
}

function displayRoundsLeftText() {
    countdownTextDisplay.textContent = `rounds left!`;
}

function deductRound() {
    let qnum = parseInt(countdownDisplay.textContent);
    if (qnum == 0) {
        audio.play();
        return;
    }    
    qnum = qnum - 1;
    countdownDisplay.textContent = qnum.toString();
    if (qnum == 0) {
        audio.play();
    } 
}    

function displayRoundButton() {
    const roundButton = document.createElement('button');
    roundButton.classList.add("round__button");
    roundButton.innerHTML = 'next round';
    roundButton.addEventListener("click", function(){
      deductRound();
    });
    countdownButtonDisplay.appendChild(roundButton);
}    

function customCountdown() {
    const qnum = parseInt(this.dataset.qnum);
    setupCountdown(qnum);
}

buttons.forEach(button => button.addEventListener('click', customCountdown));
// no need to select if element has name attribute
document.customForm.addEventListener('submit', function(e) {
    // prevent page reload on submit
    e.preventDefault();
    const qnum = this.questions.value;
    setupCountdown(qnum);
    this.reset();
});
